    <script>
        document.addEventListener("DOMContentLoaded", function() {
            // Initialize the map once the DOM is fully loaded
            var map = L.map('my_map_id');  // Directly reference the map by ID
            
            function findMyLocation() {
                if (navigator.geolocation) {
                    navigator.geolocation.getCurrentPosition(
                        function(position) {
                            var lat = position.coords.latitude;
                            var lng = position.coords.longitude;
                            map.setView([lat, lng], 15);
                            L.marker([lat, lng]).addTo(map)
                                .bindPopup("<strong>You are here</strong>").openPopup();
                        },
                        function(error) {
                            alert("Error retrieving location: " + error.message);
                        }
                    );
                } else {
                    alert("Geolocation is not supported by this browser.");
                }
            }

            // Attach the findMyLocation function to the button click
            document.querySelector('.find-location-button').addEventListener('click', findMyLocation);
        });
    </script>
